import React, {Fragment, useState} from "react";


const Register = () => {

  const [inputs, setInputs] = useState({
    email: "",
    password: "",
    name: "asd"
  })

  const {email, password, name} = inputs;

  return (
    <Fragment>
      <h1 className="text-center my-5">Register</h1>
      <form>
        <input value={email} className=" form-control my-3" type="email" name="email" placeholder="email"></input>
        <input value={password} className=" form-control my-3" type="password" name="password" placeholder="password"></input>
        <input value={name} className=" form-control my-3" type="text" name="name" placeholder="name"></input>
        <button className="btn btn-success btn-block" >Submit</button>
      </form>
    </Fragment>
  )
}

export default Register;
